const Country = ({name, capital, population, flags, languages}) => {

  const obj = languages.languages

  Object.keys(obj).map((key, index) => languages[key])

  return(
    <div>
      <h2>{name.name.common}</h2>
      <p><b>Capital: </b>{capital.capital.toString()}</p>
      <p><b>Population: </b>{population.population.toString()}</p>
      <label><b>Languages</b></label>
      <ul>
        {`${key}: ${value}`}
        {/* Object.keys(myObject).map(function(key, index) {
        myObject[key] *= 2;
        }); */}

      </ul>
      <br/>
      <div>
        <img width="100px" alt="country flag" src={flags.flags.png}/>
      </div>
    </div>
  )
}

export default Country
